import React from 'react'
import './Todo.css'

function DoneImg(props) {
    if (props.done) {
        return (<img src="./images/checked.png" alt='checked'></img>)
    } else {
        return (<img src="./images/unchecked.PNG" alt='unchecked'></img>)
    }
}

function List(props) {
    return (<ul  >
        {props.items.map(item => <li className={item.done ? "done" : ""} key={item.id}>
            {item.text}
            <button onClick={() => { props.onDone(item) }}><DoneImg done={item.done}></DoneImg></button>
            <button onClick={() => { props.onItemDeleted(item) }}><img src="./images/delete.PNG" alt='delete'></img></button>
        </li>)}
    </ul>)
}

export default List;
